import{_ as e,c as t,o as r,aM as o}from"./chunks/framework.IHAHILrl.js";const u=JSON.parse('{"title":"常见问题","description":"","frontmatter":{"title":"常见问题","date":"2025-09-02T01:16:27.000Z"},"headers":[],"relativePath":"zh/docs/getting-started/faq.md","filePath":"zh/docs/getting-started/faq.md","lastUpdated":1757478547000}'),i={name:"zh/docs/getting-started/faq.md"};function h(s,a,l,n,d,c){return r(),t("div",null,[...a[0]||(a[0]=[o('<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h1><h2 id="数据存储在哪里" tabindex="-1">数据存储在哪里？ <a class="header-anchor" href="#数据存储在哪里" aria-label="Permalink to &quot;数据存储在哪里？&quot;">​</a></h2><p>应用数据（设置、API Key、聊天记录、附件）默认都保存在本机。</p><h2 id="是否收集统计" tabindex="-1">是否收集统计？ <a class="header-anchor" href="#是否收集统计" aria-label="Permalink to &quot;是否收集统计？&quot;">​</a></h2><p>不收集。应用不包含统计或广告 SDK。</p><h2 id="为什么无法发送图片" tabindex="-1">为什么无法发送图片？ <a class="header-anchor" href="#为什么无法发送图片" aria-label="Permalink to &quot;为什么无法发送图片？&quot;">​</a></h2><p>请确认所选模型支持视觉/多模态。有些模型仅支持文本。</p><h2 id="频率限制或报错怎么办" tabindex="-1">频率限制或报错怎么办？ <a class="header-anchor" href="#频率限制或报错怎么办" aria-label="Permalink to &quot;频率限制或报错怎么办？&quot;">​</a></h2><p>不同提供商的限流不同。请降低请求频率或更换模型，并关注服务状态页。</p><h2 id="如何使用代理或自定义地址" tabindex="-1">如何使用代理或自定义地址？ <a class="header-anchor" href="#如何使用代理或自定义地址" aria-label="Permalink to &quot;如何使用代理或自定义地址？&quot;">​</a></h2><p>在“服务供应商”中设置 Base URL 与自定义请求头。详见“自定义请求”。</p><h2 id="能否导出或备份聊天" tabindex="-1">能否导出或备份聊天？ <a class="header-anchor" href="#能否导出或备份聊天" aria-label="Permalink to &quot;能否导出或备份聊天？&quot;">​</a></h2><p>可以。支持本地导出或（若配置）使用 WebDAV 等备份方式。</p><h2 id="如何重置记忆" tabindex="-1">如何重置记忆？ <a class="header-anchor" href="#如何重置记忆" aria-label="Permalink to &quot;如何重置记忆？&quot;">​</a></h2><p>在助手中关闭记忆，或清除该助手/会话的已存摘要。</p><h2 id="其他问题" tabindex="-1">其他问题？ <a class="header-anchor" href="#其他问题" aria-label="Permalink to &quot;其他问题？&quot;">​</a></h2><p>欢迎在 GitHub 提 Issue： <a href="https://github.com/Chevey339/kelivo/issues" target="_blank" rel="noreferrer">https://github.com/Chevey339/kelivo/issues</a></p>',17)])])}const b=e(i,[["render",h]]);export{u as __pageData,b as default};
